import React, { useState, useEffect, useMemo } from 'react';
import { Filter, X } from 'lucide-react';
import './FieldFilter.css';

const FieldFilter = ({ 
  records = [],
  onApplyFilter,
  onClearFilter,
  loading = false
}) => {
  const [selectedField, setSelectedField] = useState('');
  const [selectedValue, setSelectedValue] = useState('');

  // Define filterable fields from the table
  const filterableFields = [
    { key: 'transactionId', label: 'Transaction ID', type: 'text' },
    { key: 'contributorName', label: 'Contributor', type: 'text' },
    { key: 'email', label: 'Email', type: 'text' },
    { key: 'projectName', label: 'Project', type: 'text' },
    { key: 'projectObjectiveName', label: 'Project Objective', type: 'text' },
    { key: 'accountName', label: 'Account', type: 'text' },
    { key: 'status', label: 'Status', type: 'text' }
  ];

  // Extract unique values for the selected field from records
  const fieldValues = useMemo(() => {
    if (!selectedField || !Array.isArray(records) || records.length === 0) {
      return [];
    }

    const values = new Set();
    records.forEach(record => {
      if (record && record[selectedField]) {
        const value = String(record[selectedField]).trim();
        if (value) {
          values.add(value);
        }
      }
    });

    return Array.from(values).sort();
  }, [selectedField, records]);

  // Reset selected value when field changes
  useEffect(() => {
    setSelectedValue('');
  }, [selectedField]);

  const handleFieldChange = (e) => {
    setSelectedField(e.target.value);
  };

  const handleValueChange = (e) => {
    setSelectedValue(e.target.value);
  };

  const handleApply = () => {
    if (selectedField && selectedValue) {
      onApplyFilter({
        field: selectedField,
        value: selectedValue
      });
    }
  };

  const handleClear = () => {
    setSelectedField('');
    setSelectedValue('');
    onClearFilter();
  };

  const selectedFieldConfig = filterableFields.find(f => f.key === selectedField);

  return (
    <div className="field-filter-panel">
      <div className="field-filter-header">
        <Filter size={18} />
        <span>Filter Records</span>
      </div>

      <div className="field-filter-controls">
        <div className="filter-control-group">
          <label htmlFor="filter-field">Filter By:</label>
          <select
            id="filter-field"
            value={selectedField}
            onChange={handleFieldChange}
            disabled={loading}
            className="filter-field-select"
          >
            <option value="">-- Select Field --</option>
            {filterableFields.map(field => (
              <option key={field.key} value={field.key}>
                {field.label}
              </option>
            ))}
          </select>
        </div>

        {selectedField && (
          <div className="filter-control-group">
            <label htmlFor="filter-value">Value:</label>
            <select
              id="filter-value"
              value={selectedValue}
              onChange={handleValueChange}
              disabled={loading || fieldValues.length === 0}
              className="filter-value-select"
            >
              <option value="">-- Select Value --</option>
              {fieldValues.map(value => (
                <option key={value} value={value}>
                  {value}
                </option>
              ))}
            </select>
            {fieldValues.length === 0 && (
              <span className="filter-hint">No values available</span>
            )}
          </div>
        )}

        <div className="filter-actions">
          <button
            className="apply-filter-btn"
            onClick={handleApply}
            disabled={loading || !selectedField || !selectedValue}
          >
            <Filter size={16} />
            Apply Filter
          </button>
          <button
            className="clear-filter-btn"
            onClick={handleClear}
            disabled={loading}
          >
            <X size={16} />
            Clear Filter
          </button>
        </div>
      </div>
    </div>
  );
};

export default FieldFilter;
